import logo from './logo.svg';
import {useEffect} from "react";
import './App.css';
import Axios from 'axios';

function App() {

    useEffect(() => {
        Axios.get('https://jsonplaceholder.typicode.com/todos')
            .then(res => console.log(res.data)).catch(err => console.log(err))
    }, [])
  return (
    <div className="App">
      <h1>hello</h1>
    </div>
  );
}

export default App;
